import "./App.css";
import Navbar from "./Components/Navbar";
import { BrowserRouter as Router, Switch, route } from "react-router-dom";

function App(){
  return (
    <div className="App">
      <Router>
        <Navbar/>
        <switch>
          <route path="/" exact component/>
        </switch>
      </Router>
    </div>
  );
}
export default App;
